import React from 'react';

const Footer = () => {
    return (
        <div>
            <footer className="bg-dark fontifyw page-footer myfooter">
              Happy Browsing ;)
                <br/>
                <a href="https://github.com/Mgrdich "><i className="fab fa-github fa-2x"/></a>
            </footer>
        </div>
    );
};

export default Footer;
